export class Event {
    constructor(title, startTime, endTime) {
        this.title = title;
        this.startTime = startTime;
        this.endTime = endTime;
        this.duration = (endTime - startTime) / 60000;
    }

    isAllDayEvent() {
        return this.duration == 1440;
    }
}

export class Calendar {
    constructor(title, color, events) {
        this.title = title;
        this.color = color;
        this.events = events;
    }
}

export class User {
    constructor(username, calendars) {
        this.username = username;
        this.calendars = calendars;
    }
}
